import "./App.css";
import ExpenseItem from "./Components/ExpenseItem.js";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "car",
      amount: 22,
      date: "22 march 2021",
    },
    {
      id: "e2",
      title: "tv",
      amount: 22,
      date: "22 march 2021",
    },    
    {
      id: "e3",
      title: "book",
      amount: 2,
      date: "22 march 2021",
    },
  ];

  return (
    <div className="App">
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
